import Home from "./pages/Home";
import Register from "./pages/Register"
import {createBrowserRouter, RouterProvider, Route} from "react-router-dom";
const router = createBrowserRouter ([
    {
        path:"/",
        element: <Home/>
    },
    {
        path:"/register",
        element: <Register/>
    }
]);

const App = () => {
    return <RouterProvider router={router}/>;
}

export default App;
